INSERT INTO `reviewpost` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(1, 'Samsung Galaxy S22 Ultra', 1, 1, '<p>The Samsung Galaxy S22 Ultra delivers a built-in S Pen, brighter display and lots of camera upgrades in a sleek design</p><p>This Galaxy S22 Ultra review proves that Samsung knows what power users want. This new beast adds the Galaxy Notes best feature while also offering a ton of other upgrades. </p><p>Yup, there is an S Pen built-in, but there is a lot more going on with this flagship as Samsung tries to top our best phone list.</p><p>For starters, the S Pen is more responsive, as Samsung made it 70% faster with less latency. The display is also brighter and more colorful than anything we have tested, and you get faster 45W charging.</p><div><div><br></div><div><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 100%; float: none;\"></div></div><div><div><br></div><div>The biggest upgrades of Galaxy S22 Ultra come with its cameras, as Samsung is shooting to overtake the iPhone 13 Pro Max as the best camera phone with the help of a raft of upgrades. These include a bigger main sensor for better low-light photos, an AI-boosted portrait mode and a new Super Clear lens.</div></div><div><br></div><div><div>The Galaxy S22 Ultra boasts a larger 2.4um pixel sensor for capturing more light and data, as well as a Super Clear Glass lens for capturing nighttime videos without flares. You also get a 12MP ultrawide lens, plus dual 10MP telephoto cameras that combine to offer 10x optical zoom and 100x space zoom.</div><div><br></div><div><b>Youtube - Review</b></div><div><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/vXIAB_1FEC0\" style=\"width=90% ; class=\" note-video-clip\"=\"\"></iframe><br></div></div>', '2022-07-13 14:27:09', '2022-07-13 22:23:06', 1, 'Samsung-Galaxy-S22-Ultra', '7e090a4a04391fa73e97294dab7efb35.jpg');
INSERT INTO `reviewpost` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(2, 'Apple Ipad Pro 11 (2021)', 2, 2, '<p>The iPad Pro has always been ahead of the curve when it comes to hardware performance, and the new M1-based 11-inch iPad Pro pushes that even further, offering PC-like performance on a tablet. That said, it feels like the iPad is at a stage where Apple really needs to up its software game to match the hardware, and even the upcoming iPadOS 15 doesnt really take advantage of the power available to it.</p><p>Along with the larger 12.9-inch iPad Pro, Apple has also updated the 11-inch iPad, bringing it in line with its larger sibling by incorporating most of that features tablets, but in a more manageable size.&nbsp;</p><p>However, the smaller iPad is missing the Liquid Retina XDR Mini LED display which, in our opinion, is the standout feature of this years top-end model.</p><p>The iPad has never felt slow but the specs on this latest generation give it plenty of future-proofing headroom for years to come. You can equip the new iPad Pro with 16GB of RAM and 2TB of storage –specs that match those of the highest-end M1 based MacBook Pro.&nbsp;</p><p>Apple will say that it is in order to make to make the best iPad it can, but the restrictive iPadOS doesnt really allow you to take full advantage of all the power thats on tap – multi-tasking still isnt very intuitive, external display support is weak, file management is still very basic, and options to expand the iPads functionality via accessories is still limited.<br></p><p><br><br></p><p><br></p>', '2022-07-13 22:16:47', NULL, 1, 'Apple-Ipad-Pro-11-(2021)', '4254a2b3d44f5a53aaa44fc94116fc12.jpg'),
(3, 'Apple Macbook Pro (2021)', 3, 3, '<p>Apple in October 2021 overhauled the high-end MacBook Pro, introducing an entirely new design, new chips, new capabilities, and more. As Apple says, the revamped MacBook Pro models offer up extraordinary performance and it is the world best notebook display.</p><p>The 2021 MacBook Pro models come in 14.2-inch and 16.2-inch size options and they are equipped with mini-LED displays, more ports, up to 64GB memory, and more powerful Apple silicon chips, the M1 Pro and M1 Max. In short, they are the best MacBook Pro models to date.</p><p>Apple new MacBook Pro models can be configured with the M1 Pro chip or the M1 Max chip. Both chips feature a 10-core CPU with eight high-performance cores and two high-efficiency cores, though there is a lower-end 8-core model available for the entry-level 14-inch MacBook Pro. There is also a 16-core Neural Engine in both chips.</p>', '2022-07-13 22:28:43', NULL, 1, 'Apple-Macbook-Pro-(2021)', 'cbaba411b63781b49e897c34f31ee95c.jpg'),
(4, 'Apple Macbook Pro (2021)', 3, 3, '<p>Apple in October 2021 overhauled the high-end MacBook Pro, introducing an entirely new design, new chips, new capabilities, and more. As Apple says, the revamped MacBook Pro models offer up extraordinary performance and it is the world best notebook display.</p><p>The 2021 MacBook Pro models come in 14.2-inch and 16.2-inch size options and they are equipped with mini-LED displays, more ports, up to 64GB memory, and more powerful Apple silicon chips, the M1 Pro and M1 Max. In short, they are the best MacBook Pro models to date.</p><p>Apple new MacBook Pro models can be configured with the M1 Pro chip or the M1 Max chip. Both chips feature a 10-core CPU with eight high-performance cores and two high-efficiency cores, though there is a lower-end 8-core model available for the entry-level 14-inch MacBook Pro. There is also a 16-core Neural Engine in both chips.</p>', '2022-07-14 09:47:13', '2022-07-14 09:57:15', 0, 'Apple-Macbook-Pro-(2021)', 'cbaba411b63781b49e897c34f31ee95c.jpg');

