INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(3, 'Samsung Galaxy S series (Comes With Pen)', 4, 6, '<p>The Samsung Galaxy S22 Ultra delivers a built-in S Pen, brighter display and lots of camera upgrades in a sleek design</p><p>This Galaxy S22 Ultra review proves that Samsung knows what power users want. This new beast adds the Galaxy Notes best feature while also offering a ton of other upgrades. </p><p>Yup, there is an S Pen built-in, but there is a lot more going on with this flagship as Samsung tries to top our best phone list.</p><p>For starters, the S Pen is more responsive, as Samsung made it 70% faster with less latency. The display is also brighter and more colorful than anything we have tested, and you get faster 45W charging.</p><div><div><br></div><div><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 100%; float: none;\"></div></div><div><div><br></div><div>The biggest upgrades of Galaxy S22 Ultra come with its cameras, as Samsung is shooting to overtake the iPhone 13 Pro Max as the best camera phone with the help of a raft of upgrades. These include a bigger main sensor for better low-light photos, an AI-boosted portrait mode and a new Super Clear lens.</div></div><div><br></div><div><div>The Galaxy S22 Ultra boasts a larger 2.4um pixel sensor for capturing more light and data, as well as a Super Clear Glass lens for capturing nighttime videos without flares. You also get a 12MP ultrawide lens, plus dual 10MP telephoto cameras that combine to offer 10x optical zoom and 100x space zoom.</div><div><br></div><div><b>Youtube - Review</b></div><div><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/vXIAB_1FEC0\" style=\"width=90% ; class=\" note-video-clip\"=\"\"></iframe><br></div></div>', '2022-07-12 17:26:26', '2022-07-18 19:07:17', 1, 'Samsung-Galaxy-S-series-(Comes-With-Pen)', '7e090a4a04391fa73e97294dab7efb35.jpg');
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(4, 'Security tips to keep your device safe', 5, 7, '<p>1) Keep Your Phone Locked</p><p>One potential threat is getting your device stolen, which could give the thief complete access to your personal information. To prevent this, be sure to have a lock on your screen. Whether this is a passcode, pattern, fingerprint, or face recognition is up to you and the capabilities of your device.</p><p>When enabling a lock screen you will have the option to choose how long the phone can be idle before locking. Be sure to choose the shortest amount of time. This will protect you, by automatically enacting the lock screen even if you forget to lock it yourself. It will also save your battery because the screen will go dark after a set amount of time.<br><br></p><p>2) Keep Your Device OS Up-To-Date</p><p>Mobile phone operating system updates are intended to improve your experience. This could entail anything from performance to security. Although they happen frequently and users tend to click through quickly or ask the device to remind them in the future, it is important to stay up to date with these. These updates can protect both iOS and Android devices from newly discovered threats.&nbsp;<br><br></p><p>3) Connect to Secure Wifi</p><p>The beauty of mobile devices is that we can access the internet anywhere and everywhere we go. While free wifi can save us on data, it is important to be wary of unsecured networks.</p><p>To stay safe while using public wifi, be sure to connect to a virtual private network or VPN. Check out Panda VPN for Android, which allows you to enjoy a secure Wi-Fi connection even on public networks. Changing your virtual network will protect your location and keep your information from prying eyes. On the other end, make sure you keep your Wifi secure to prevent others from accessing your network.<br><br></p><p>5) Beware of Downloads</p><p>When you are downloading apps, be sure to download them from the official app stores and check reviews. Cybercriminals create rogue mobile apps that mimic trusted brands in order to obtain users confidential information. To avoid this trap, be sure to look at the number of reviews, last updates, and contact information of the organization.</p><p><br></p>', '2022-07-14 09:05:40', NULL, 1, 'Security-tips-to-keep-your-device-safe', '405bf3768a983ac46e4ce202ac076e7c.jpg'),
(5, 'Apple Macbook Air (2022) (New Release)', 7, 8, '<p>Apple in June 2022 introduced an updated and redesigned MacBook Air that features the biggest design overhaul to the MacBook Air line since 2010, and the first use of the new M2 chip.</p><p>The 2022 MacBook Air looks entirely different from the prior-generation version, featuring an updated chassis that does away with the tapered design that the MacBook Air used for so long. Instead, the MacBook Air adopts a uniform, flat body similar to the MacBook Pro.</p><p>The MacBook Air is 11.3mm thick, making it a bit thinner than the prior-generation MacBook Air, and it weighs 2.7 pounds. It is just about the same size as the prior-generation model at 11.97 inches wide and 8.46 inches tall.</p><p>Thin black bezels surround an updated 13.6-inch Liquid Retina Display that supports 1 billion colors and features 500 nits brightness, making it 25 percent brighter than before.</p><p>There is a notch at the front of the MacBook Air display, which allows for more screen space around the updated 1080p FaceTime HD camera. Apple added a built-in four-speaker sound system that supports spatial audio and wide stereo. It also features a three-microphone array.</p><p>The MacBook Air comes in Silver, Space Gray, Starlight, and Midnight, the latter of which is a new dark blue shade that is almost black. The MacBook Air continues to feature a black keyboard with a Touch ID and a large Force Touch trackpad.</p><p>Two USB-C ports are available on the MacBook Air along with a MagSafe port for charging purposes and a 3.5mm headphone jack with support for high-impedance headphones.</p><p>The battery in the MacBook Air lasts for up to 18 hours when watching movies or TV, and up to 15 hours when browsing the web. It supports fast charging with an optional 67W USB-C power adapter.</p><p>Apple MacBook Air is equipped with a next-generation M2 chip, a follow-up to the original M1. The M2 chip features an 8-core CPU and up to a 10-core GPU, along with support for up to 24GB of memory. Compared to the M1, the M2 offers advancements in performance and efficiency with an 18 percent faster CPU, a 35 percent faster GPU, and a 40 percent faster Neural Engine.</p>', '2022-07-18 18:36:21', '2022-07-18 18:46:53', 1, 'Apple-Macbook-Air-(2022)-(New-Release)', '7380c1cb0e8866783eede5b4d9e319a1.jpg');
INSERT INTO `tblposts` (`id`, `PostTitle`, `CategoryId`, `SubCategoryId`, `PostDetails`, `PostingDate`, `UpdationDate`, `Is_Active`, `PostUrl`, `PostImage`) VALUES
(6, 'Apple Macbook Pro (2022) (New Release)', 7, 8, '<p>Apple has announced that the first batch of second-generation Apple Silicon chips which is aptly called M2 will be heading to two MacBook models right off the bat. One of them is the 13-inch MacBook Pro which is now available for order in Malaysia.</p><p>This is despite the earlier notice on Apple Malaysia’s website which said that the model will only arrive in our market next month. As per what we have reported two weeks ago, the M2-based MacBook Pro 13 is essentially a refreshed model and is almost no different from its M1 processor.</p><div><div><br></div><div><img src=\"data:image/jpeg;base64,\" data-filename=\"pro spec.jpg\" style=\"width: 100%; float: none;\"></div></div><div><div><br></div></div>Hence, the 2022 M2-based iteration of the model still features a 13.3-inch Retina display that has a 2560 x 1600 resolution, brightness level of 500nits, P3 colour gamut coverage, and True Tone technology. Touch Bar, 720p FaceTime HD camera and two USB-C Thunderbolt ports are also standard together with 17 hours of battery life for web browsing or 20 hours for Apple TV playback.<p></p><div><div><p></p><p>Regardless of the configurations that customers choose, the M2 chip that has been equipped with the MacBook Pro 13 carries an 8-core CPU, 10-core GPU, and 16-core Neural Engine. Unlike the 2022 MacBook Air whereby users get to choose between the new 35W USB-C Dual USB-C Power Adapter and 67W USB-C Power Adapter if they purchase the 10-core GPU version with at least 512GB SSD, the MacBook Pro 13 comes standard with the latter.</p><p>For consumers in Malaysia, the base variant is equipped with 8GB unified memory alongside 256GB internal storage and a price tag of RM5,699. For those who want to go all the way, the fully beefed-up variant carries 24GB memory and 2TB SSD for RM10,499.</p></div></div>', '2022-07-18 18:45:26', '2022-07-18 18:58:23', 1, 'Apple-Macbook-Pro-(2022)-(New-Release)', '033434ad85ce928c6b875e5ddb523340.jpg');
